import { gql } from "@apollo/client";

export const ALL_CHARACTERS = gql`
  {
    allPeople {
      people {
        name
        gender
        birthYear
        homeworld {
          name
        }
        hairColor
        height
        filmConnection {
          films {
            title
            director
            producers
            openingCrawl
            releaseDate
          }
        }
      }
    }
  }
`;
